import React from 'react';
import { Typography, Box } from '@mui/material';

const Header = () => {
    return (
        <Box textAlign="center" py={3} bgcolor="#00304b" color="white">
            <Typography variant="h4">Personalized Email Outreach</Typography>
        </Box>
    );
};

export default Header;
